import Button from "./components/Login/Button";
import React from "react";
import { Card, Container, Form, Image } from "react-bootstrap";

import BeitragDeck from "./components/Browsing/BeitragDeck";
import Header1 from "./components/Login/Header1";
import { Navbar1, showInFront } from "./components/Navbar1";
import Inputfield from "./components/Login/Inputfield";
import { BiImages as AiFillPicture } from "react-icons/bi";
import DragandDrop from "./components/Login/DragandDrop";

const UserPage = () => {
  return (
    <>
      <Navbar1 className="m-0"></Navbar1>
      <Header1 str="Nutzer" className="m-0"></Header1>
      <img
        className="border p-0 center w-25 mt-4"
        src="http://placekitten.com/200/200"
      ></img>
      <Container className="border mt-5">
        <p>
          User: Max
          <br />
          E-mail: email@beispiel.com
          <br />
          Ersteanmeldung: 27.03.2021
          <br />
          letzteAnmeldung:18.02.2021
        </p>
      </Container>

      <Container>
        <Button
          text="neuer Post"
          className2="w-100 mt-4"
          variant="secondary"
          onClick={function () {
            showInFront(
              '<div id="newPost" class="border container inFront" style="right: 92.5px; top: 248px;"><div class="nichtRund card"><div class="p-0 m-0 card-header"><div class="App p-0 "><form class="p-0 p-1 nichtRund"><div class="p-0 m-0 form-group"><input placeholder="Postüberschrift" class="form-control"></div></form></div></div><div class="p-0 card-body"><div class="container"><div class="border nichtRund container"><div class="p-0 m-3 card-body"><div><div class="dad" tabindex="0"><input accept="image/*" multiple="" type="file" autocomplete="off" tabindex="-1" style="display: none;"><div id="dadPlatzhalter">sss</div><div class="draganddopBild"></div></div></div></div><div class="mt-4 p-0 bg-white card-footer"><button type="button" class="btn btn-secondary"><h4><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" class="Icon" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M20,2H8C6.897,2,6,2.897,6,4v12c0,1.103,0.897,2,2,2h12c1.103,0,2-0.897,2-2V4C22,2.897,21.103,2,20,2z M8,16V4h12 l0.002,12H8z"></path><path d="M4,8H2v12c0,1.103,0.897,2,2,2h12v-2H4V8z"></path><path d="M12 12L11 11 9 14 19 14 15 8z"></path></svg></h4></button><button type="button" class="m-2 btn btn-secondary"><h4><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" class="Icon" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M20,2H8C6.897,2,6,2.897,6,4v12c0,1.103,0.897,2,2,2h12c1.103,0,2-0.897,2-2V4C22,2.897,21.103,2,20,2z M8,16V4h12 l0.002,12H8z"></path><path d="M4,8H2v12c0,1.103,0.897,2,2,2h12v-2H4V8z"></path><path d="M12 12L11 11 9 14 19 14 15 8z"></path></svg></h4></button></div></div></div></div><div class="p-0 card-footer"><div class="App p-0 "><form class="p-0 p-1"><div class="p-0 m-0 form-group"><input placeholder="Text" class="form-control"></div></form><'
            );
          }}
        ></Button>
      </Container>

      <BeitragDeck className=""></BeitragDeck>
    </>
  );
};

const newPost = () => {
  return (
    <Container className="hide border" id="newPost">
      <Card className="nichtRund">
        <Card.Header className="p-0 m-0">
          <Inputfield
            placeholder="Postüberschrift"
            ohneueberschrift={true}
            className="w-100  p-0 nichtRund"
            className2="p-1 nichtRund"
          ></Inputfield>
        </Card.Header>

        <Card.Body className="p-0">
          <Container>
            <Container className="border nichtRund">
              <Card.Body className="p-0 m-3">
                <DragandDrop className="m-0"></DragandDrop>
              </Card.Body>
              <Card.Footer className="mt-4 p-0 bg-white">
                <Button
                  text={<AiFillPicture className="Icon" />}
                  className2=""
                  variant="secondary"
                  onClick={function () {
                    showInFront("newPost");
                  }}
                ></Button>
                <Button
                  text={<AiFillPicture className="Icon" />}
                  className="m-4"
                  className2="m-2"
                  variant="secondary"
                  onClick={function () {
                    showInFront("newPost");
                  }}
                ></Button>
              </Card.Footer>
            </Container>
          </Container>
        </Card.Body>

        <Card.Footer className="p-0">
          <Inputfield
            placeholder="Text"
            ohneueberschrift={true}
            className="w-100 "
            className2="p-1"
          ></Inputfield>
        </Card.Footer>
      </Card>

      <Button
        text="neuer Post"
        className2="w-100 mt-4"
        variant="secondary"
        onClick={function () {}}
      ></Button>
    </Container>
  );
};

export default UserPage;
